import { useEffect, useState } from "react";
import { BasicApi } from "./basic_api";
const LoginApi = (url, data) => {
  const [response, setResponse] = useState();
  useEffect(() => {
    BasicApi(url, data).then((res) => setResponse(res));
  });

  return response;
};

export default LoginApi;
